import React from 'react';
import './App.css';
import Header from './components/header/Header';
import Home from './home/Home';
import About from './about/About';

function App() {
  return (
    <>

    <Header />
    <main className="main">
    <Home/> 
    <About/>
    </main>


    </>
  );
}

export default App;
